(2672, 'ru', 'settings', 'seopanel_description', 'Панель управления поисковой оптимизации сайтов. Содержащего большое количество инструментов для увеличения и отслеживания посещения ваших сайтов. Seo panel инструмент с открытым исходным кодом. Вы можете принять участие в разработке своих собственных плагинов для Seo panel.', '2014-05-09 06:16:23'),
