(3400, 'bg', 'settings', 'seopanel_description', 'Напълно безплатен контролен панел, за управление на оптимизацията за търсещи машини на вашият уеб сайт. Предоставящ много SEO инструменти за оптимизация, увеличаване и проследяване, представянето на вашите уеб сайтове. Софтуер с отворен код, предоставящ ви възможност да развиете собствени SEO модули за Seo Panel.\r\n', '2014-01-07 14:29:49'),
