(3640, 'tr', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Seo Panel\\''e Hoşgeldiniz - En çok\r\ntercih edilen bir çok sitenin seo paneli</h1>\r\n        <p>\r\n            sitenizin <b>arama motoru optimizasyonu</b> kontrolu için tamamen <b>açık kaynak kodlu seo</b>\r\n<b>kontrol paneli</b>\r\n\r\n            Seo Panel bir <b>seo aracıdır</b> ve sitenizin <b>hitini ve performansını arttırmak</b> için en son\r\n araçlara sahip.\r\n            <b>Ücretsiz</b> bir software ve <b>GNU GENERAL PUBLIC LICENSE</b>\\''a sahiptir.\r\n            Seo panelin ana özelliği <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">seo pluginler</a>\r\nkullanarak <b>genişletilebilirliği</b>\r\n.\r\n            Herkes kolayca kendi gerekli seo pluginleri <b>geliştirebilir ve yükleyebilir</b>. \r\n        </p>\r\n        <p></p>\r\n        <p>\r\n            Bu open source software <b>yayım tarihi Ocak 2010</b>.\r\n            Bu <b>kısa sürede binlerce webmaster</b> bu software\\''i kullanarak sitelerini optimize ediyor.\r\n            Bugün <b>tek bir platform</b> altında seo paneli kullanın.\r\n        </p>', '2011-07-15 03:25:54'),
(3641, 'tr', 'home', 'home_cont2', '<fieldset>\r\n<legend>Seo Panel Ana Özellikleri<?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Automatik Directory Ekleme Aracı</h1>\r\n        <p>\r\n            Automatik directory ekleme aracı bize <b>sitelerimizi</b> ücretli ya da ücretsiz ana internet rehberlerine\r\neklememize yardımcı olur.\r\n            Hatta <b>statu kontrol script</b>i ile herbir rehbere ekli siteyi kontrol edebiliriz.\r\n            <b>Directory yöneticisi</b> aktif olsada olmasada bize bulmamızda yardımcı olur.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Anahtar kelime (keyword) Pozisyon Kontrol</h1>\r\n        <p>\r\n            Anahtar kelime pozisyon kontrolu sayesinde sistemdeki sitenize ait <b>hedef kelimenin arama motorundaki pozisyonunu</b>\r\nkontrol edebilir ve kaydedebilirsiniz.\r\n            Anahtar kelime pozisyon bölümünde, ayrıntılı raporlar ile grafikli farklı arama motorlarındaki analizleri görebiliriz.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Site Denetçisi</h1>\r\n        <p>Site Denetçisi bir siteye ait her bir sayfadaki <b>tüm seo faktörlerini denetlicek</b> ve hersayfa hakkında\r\n<b>detaylı rapor vericek</b>. Buda <b>XML,HTML,TEXT</b> arama motorlarına gönderilecek sitenizin sitemap dosyasını\r\noluşturmaya yardımcı olacak.</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Google ve Alexa Rank Kontrol</h1>\r\n        <p>\r\n            Google ve alexa rank kontrolu websitenizin <b>google pagerank</b> ve <b>alexa rank</b>ini bulur\r\nve sistem içine <b>kayıt</b> eder.\r\n            <b>Rank raporları</b> bölümünde, <b>günlük</b> google ve alexa rank\\''lerini <b>detaylı raporlarla</b> görebiliriz.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Backlink Kontrol</h1>\r\n        <p>\r\n            Backlinks Kontrol arama mototlarında (<b>google,yahoo,msn</b> etc) <b>backlinklerin sayısını</b> bulur ve sisteme kayıt eder.\r\n            <br><b>Backlink raporları</b> bölümünde, detaylı raporları ile birlikte herbir siteye ait <b>günlük backlink sayıları</b> bulunur.\r\n        </p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Arama Motoru İndex Kontrol</h1>\r\n        <p>\r\n            Arama Motoru İndex Kontrol farklı arama motorlarına (<b>google,yahoo,msn</b> etc) ait <b>indexlenmiş\r\nsayfaların sayısını</b> gösteririr ve sisteme kaydeder.\r\n            <b>Arama Motoru İndex Kontrol raporları</b> böşümünde, detaylı raporları ile herbir siteye ait\r\n<b>günlük indexli sayfa sayısını</b>gösterir.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Seo Panel Pluginleri</h1>\r\n        <p>\r\n            Seo Panalin <b>ana özelliği</b> <b>genişletilebilirliği</b>.\r\n            <b>Seo pluginleri</b>size gerekli olanlar çercevesinde özelliklerinizi geliştirmek için kendi panelinize eleyin.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel pluginler</a> seo panel ve\r\nüçüncü parti yazılımları destekler.\r\n            Seo pluginleri seo panel için kolayca <b>geliştirebilirsiniz</b>.\r\n            Seo pluginleri seo panelinize <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">ekleyebilirsiniz</a> ve\r\nBiz gözden geçirme prosesinden sonra kendi sitemizde <b>yayınlarız</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Meta Tag Oluşturucu</h1>\r\n        <p>\r\n            Meta tag Oluşturucu sitemize meta tagler oluşturmak için bir <b>seo panel pluginidir</b>.\r\n            Arama motorlar <b>botları</b> sitemizi listelerken daha fazla bilgi alabilmeri için yardımcı olur.\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-15 03:25:54'),
(3642, 'tr', 'home', 'home_cont3', '<fieldset>\r\n<legend>Seo Panel Online Kaynaklar</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Seo Panel Online Kaynaklar</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Seo Panel Resmi Site</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Seo Panel İndir</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Demo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Seo Panel İletişim</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Yardım</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel Forum</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel Destek Sistemi</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Seo Panel\\''e Bağış Yap</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2011-07-15 03:25:54'),
