(7909, 'vn', 'support', 'support_cont1', '<fieldset>\r\n<legend>Hệ thống hỗ trợ Seo panel</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>Gói 1000 danh bạ</h1>\r\n        <p>\r\n            Chúng tôi đang cung cấp <b>miễn phí kích hoạt và xác minh 1000</b> gói danh bạthư mục internet, để thêm vào\r\ncủa bạn seo panel <b> công cụ gửi danh bạ</b>.\r\n            Nó sẽ giúp bạn <b> tăng backlinks </b> của trang web của bạn.\r\n            Trên thực tế 1000 danh sách thư mục danh bạ là <b> giới thiệu </b> để thu thập một số tiền cho <b> tương lai\r\nphát triển </b> seo panel.\r\n            Để có được 1000 danh sách thư mục xin vui lòng <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\"> ủng hộ </a>\r\n$10 hoặc nhiều hơn để cải thiện các tính năng của bảng điều khiển seo.\r\n            Nếu bạn có bất kỳ câu hỏi về 1000 gói thư mục, xin vui lòng <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\"> liên hệ với chúng tôi </a> hoặc mở một vé trong <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\"> hệ thống hỗ trợ </a>.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\"> Bạn hãy xem liên kết này để quyên góp cho seo panel</a>\r\n        </p>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1> địa phương Tìm kiếm Công cụ trọn gói </h1>\r\n        <p>\r\n            Thêm <b> lĩnh vực công cụ tìm kiếm địa phương </b> của google, yahoo, msn (<b> ví dụ như: www.google.de, www.google.fr... </b>) để kiểm tra <b> vị trí bảng điều khiển từ khóa seo </b>, để theo dõi Biến trang web của bạn tại địa phương.\r\n            Để có được công cụ tìm kiếm địa phương gói (theo yêu cầu của bạn), xin vui lòng <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\"> ủng hộ </a> $ 10 hoặc nhiều hơn để cải thiện các tính năng của seo\r\nbảng điều khiển.\r\n            Trước khi gửi ủng hộ, xin vui lòng <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">liên hệ với chúng tôi</a> cung cấp chúng tôi yêu cầu danh sách công cụ tìm kiếm tên miền.\r\n            <br>\r\n            Ngoài ra để thêm công cụ tìm kiếm <b> mới (ví dụ như: baidu.com) </b> để kiểm tra bảng điều khiển vị trí của bạn seo từ khóa, xin vui lòng <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\"> liên hệ với chúng tôi </a> hoặc mở một vé máy bay trong một\r\n<a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\"> hỗ trợ hệ thống </a>.\r\n        </p>\r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\"> Bạn hãy xem liên kết này để liên hệ với chúng tôi </a>\r\n        </p>        \r\n    </li>\r\n    \r\n    <li>\r\n        <h1> Seo Panel Plugins </h1>\r\n        <p>\r\n            Thêm <b> seo plugin </b> vào bảng seo của bạn để <b> mở rộng các tính năng </b> theo của bạn\r\nyêu cầu.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\"> seo panel bổ sung </a> được cung cấp bởi cả hai bảng điều khiển seo\r\nvà các trang web của bên thứ ba.\r\n            Bạn cũng có thể dễ dàng <b> phát triển </b> seo plugin cho bảng điều khiển seo của bạn.\r\n            Bạn có thể <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\"> trình </a> Plugin seo seo bảng và chúng tôi <b> sẽ công bố </b> nó trong trang web của chúng tôi sau khi xem xét <b> của chúng tôi </b> quá trình.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\"> Bạn hãy xem liên kết này để có được seo panel bổ sung </a>\r\n        </p>        \r\n    </li>\r\n    <li>\r\n        <h1> Liên hệ </h1>\r\n        <p>\r\n            Liên hệ với chúng tôi để bất kỳ câu hỏi nào về <b> bảng điều khiển công cụ seo, bổ sung và các tính năng ... </b> bằng cách sử dụng liên kết dưới đây.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\"> Bạn hãy xem liên kết này để liên hệ với chúng tôi </a>\r\n        </p>\r\n    </li>\r\n    <li>\r\n        <h1>Gửi yêu cầu hỗ trợ </h1>\r\n        <p>\r\n            Để có được <b>hỗ trợ kỹ thuật</b> từ nhóm seo panel để thiết lập các công cụ <b> seo panel, bổ sung các tính năng </b>. Ví dụ: Để thiết lập định kỳ để kiểm tra vị trí từ khóa.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\"> Truy cập vào liên kết này để tạo ra một vé hỗ trợ </a>\r\n        </p>        \r\n    </li>\r\n    <li>\r\n        <h1> Báo cáo các lỗi</h1>\r\n        <p>\r\n            Báo cáo <b> lỗi </b> về <b> bảng điều khiển công cụ seo, bổ sung và các tính năng ... </b> bằng cách sử dụng liên kết dưới đây.\r\n            xin vui lòng giúp chúng tôi cải tiến các tính năng trong phiên bản tiếp theo.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\"> Truy cập vào liên kết này để báo cáo lỗi </a>\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2012-02-02 21:57:48'),
(7910, 'vn', 'support', 'support_cont2', '<fieldset>\r\n<legend>Tài nguyên Online của Seo Panel</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n        <h1>Hướng dẫn trợ giúp Seo Panel</h1> \r\n        <p>\r\n            Ban có thể xem <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\"> văn bảnseo panel</a> trong \r\n<b>Hướng dẫn trợ giúp</b>, nó bao gồm <b>văn bản</b> cho seo panel, plugins và các tính năng liên quan.\r\n            <br>Nó là nơi tốt nhất trên internet để <b>có trợ giúp</b> về seo panel. Chúng tôi hy vọng bạn \r\n<b>giúp đỡ</b> cho seo panel hướng dẫn trợ giúp, nếu bạn tìm thấy lỗi hoặc bất cứ gì bạn nghĩ là thiếu.                \r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Xem Hướng dẫn trợ giúp Seo Panel</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Diễn đàn Seo Panel</h1> \r\n        <p>\r\n            Là nơi thảo luận của những người yêu thích <b>bảng điều kiển seo mã nguồn mở đầu tiên của thế giới</b>. \r\n            Đây là nơi tốt nhất để tìm từ <b>câu trả lời</b> tới <b>câu hỏi</b> về seo panel. \r\n            <br>Bạn cũng có thể <b>chia sẻ</b>  <b>kinh nghiệm</b> của bạn trong quá trình sử dụng seo panel để tối ưu\r\nwebsites của bạn.                               \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Xem Diễn đàn Seo Panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>    \r\n</fieldset>', '2012-02-02 21:57:48'),
(7911, 'vn', 'support', 'support_cont3', '<fieldset> \r\n<legend>Ủng hộ cho Seo Panel</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1>Ủng hộ cho Seo Panel - Bảng điều kiển seo mã nguồn mở đầu tiên trên thế giới</h1>  \r\n        <p> \r\n            <b>Ủng hộ</b> cho seo panel để hỗ trợ bảng điều kiển seo mã nguồn mở đầu tiên trên thế giới. \r\n            Chúng tôi đang có kế hoạch <b>thêm và nâng cấp</b> tính năng của seo panel trong tương lai.  \r\n            <br>Chỉ có <b>hỗ trợ</b> của bạn mới giúp chúng tôi đạt được <b>mục tiêu</b>. \r\n            If you feel that seo panel is <b>worth</b> for you, please ủng hộ some amount to seo panel team. \r\n			Nếu bạn cảm thấy seo bảng điều khiển là <b> giá trị </b> cho bạn, xin vui lòng ủng hộ một số tiền cho nhóm seo panel.\r\n            <br>Chúng tôi sẽ <b>công khai</b> tên và website của bạn trên <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">trang ủng hộ</a>, ngay khi chúng tôi nhận được ủng hộ. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Vào liên kết này để ủng hộ cho seo panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2012-02-02 21:57:48'),
