(8215, 'sk', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Víta vás SEO panel - prvý svetový ovládací SEO panel na spravovanie viacerých webstránok</h1>\r\n \r\n        <p> \r\n            Kompletný <b>SEO panel s otvoreným kódom</b> na spravovanie <b>optimalizácie</b> vašich webstránok. \r\n            SEO panel je <b>nástroj pre SEO</b>, ktorý zahŕňa najnovšie špičkové SEO nástroje na <b>sledovanie a zvýšenie výkonu</b> vašich webstránok. \r\n            Je to <b>voľne stiahnuteľný softvér</b> zverejnený pod <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n           \r\n            Hlavnou výhodou SEO panelu je jeho <b>rozšíriteľnosť</b> pomocou <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">SEO pluginov</a>. \r\n            Ktokoľvek môže jednoducho <b>vyvíjať a inštalovať</b> požadované pluginy pro svoj SEO panel. \r\n        </p> \r\n        <p></p>\r\n        <p> \r\n            Tento voľne dostupný softvér bol <b>vydaný v januári 2010</b>. \r\n            Behom tejto <b>krátkej doby</b> <b>tisíce administrátorov</b> používa tento softvér k <b>optimalizácii</b> ich webstránok. \r\n            Používejte SEO panel tiež a <b>užite si</b> všetkého čo súvisí so SEO pod <b>jedinou platformou</b>. \r\n        </p>       ', '2012-02-27 04:11:51'),
(8216, 'sk', 'home', 'home_cont2', '<fieldset> \r\n<legend>Hlavné vlastnosti aplikácie SEO Panel <?=SP_INSTALLED?></legend> \r\n<ul class=\\"infobox\\"> \r\n    <li>         \r\n        <h1>Automatický nástroj na registráciu do katalógov</h1> \r\n        <p> \r\n          Automatický nástroj na registráciu do katalógov nám umožňuje <b>registrovaťť naše webstránky</b> do hlavných <b>bezplatných a platených internetových katalógov</b>.\r\n           Môžeme tiež <b>zisťovať stav</b> každej registrácie prostredníctvom <b>pravidelných kontrol</b> použitím skriptu <b>kontroly stavu registrácie</b>.\r\n           <b>Správca katalógov</b> nám pomôže zistiť, či je <b>katalóg aktívny</b>, alebo nie.\r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Kontrola pozícií kľúčových slov</h1> \r\n        <p> \r\n            Kontrola pozícií kľúčových slov zistí <b>pozície kľúčových slov</b> vašej webstránky v <b>internetových vyhledávačoch</b> a <b>uloží ich</b> v systéme.\r\n         V časti výpisov pozícií kľúčových slov môžeme vidieť <b>denné pozície</b> kľúčových slov v rôznych vyhľadávačoch prostredníctvom <b>pekných grafov</b> a <b>detailných výpisov</b>.\r\n        </p> \r\n    </li> \r\n    <li>        \r\n        <h1>Auditor webstránky</h1>\r\n        <p>Auditor webstránky <b>prejde všetky SEO faktory</b> každej stránky na webe a podá nám\r\n<b>datailný výpis</b> o každej stránke. Toto nám pomôže vytvoriť <b>XML,HTML,TEXT</b> sitemapu webstránky, ktorú môžeme <b>vložiť</b> do vyhľadávačov.</p>\r\n    </li> \r\n<li>        \r\n        <h1>Kontrola Google and Alexa rankov</h1>\r\n        <p>\r\n            Kontrola google and alexa rankov zistí <b>google pagerank</b> a <b>alexa rank</b> našich webstránok a <b>uloží</b> ich v systéme.\r\n            V časti <b>výpisov rankov</b> môžeme vidieť <b>denne</b> v <b>detailných výpisoch</b> google pagerank and alexa rank každej webstránky .\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Kontrola spätných odkazov</h1>\r\n        <p>\r\n            Nástroj na kontrolu spätných odkazov nájde <b>počet spätných odkazov</b> našich webstránok v rôznych vyhľadávačoch <b>(google,yahoo,msn atď.)</b> a <b>uloží</b> ich v systéme.\r\n            <br>V časti <b>výpisoch spätných odkazov</b> môžeme vidieť v <b>detailných výpisoch</b> <b>denné množstvo spätných odkazov</b> každej webstránky.\r\n        </p>\r\n    </li> \r\n<li>        \r\n        <h1>Kontrola indexácie vyhľadávačmi</h1>\r\n        <p>\r\n            Kontrola indexácie vyhľadávačmi nájde <b>počet zaindexovaných stránok</b> naších webstránok v rôznych vyhľadávačoch <b>(google,yahoo,msn atď.)</b> a <b>uloží</b> ich v systéme.\r\n            V časti <b>kontrola indexácie vyhľadávačmi</b> môžeme vidieť <b>denné množstvo zaindexovaných stránok</b> každej webstránky v <b>detailných výpisoch</b>.\r\n        </p>\r\n    </li> \r\n<li>        \r\n        <h1>Seo Panel pluginy</h1>\r\n        <p>\r\n            <b>Hlavnou výhodou</b> SEO panelu je jeho <b>rozšíriteľnosť</b>.\r\n            Pridajte si <b>SEO pluginy</b> do vášho SEO panelu na <b>rozšírenie funkcií</b> v závislosti na vašich požiadavkách.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel pluginy</a> sú poskytované prostredníctvom SEO panelu a prostredníctovm tretích strán.\r\n            Môžete tiež jednoducho <b>vyvinúť</b> SEO pluginy pre váš SEO panel.\r\n            Môžete <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">vložiť</a> váš SEO plugin do seo panelu a my ho budeme <b>publikovať</b> na našej webstránke po našom <b>preskúmaní</b>.\r\n        </p>\r\n    </li> \r\n    <li>        \r\n        <h1>Generátor meta tagov</h1>\r\n        <p>\r\n            Generátor meta tagov je <b>SEO panel plugin</b> na vytváranie <b>meta tagov</b> pre našu webstránku.\r\n            Pomôže vám to dať <b>viac informácií</b> o našej webstránke <b>vyhľadávacím robotom</b>, počas toho ako prechádzajú našu webstránku.\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>\r\n   ', '2012-02-27 04:11:51'),
(8217, 'sk', 'home', 'home_cont3', '<fieldset>\r\n<legend>Seo Panel online zdroje</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Referencie</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Oficiálna stránka projektu</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Stiahnuť</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Demo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Kontakt</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Nápoveda</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Fórum</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Technická podpora</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Podporiť</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2012-02-27 04:11:51'),
