(8807, 'id', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Selamat Datang di Seo Panel - Panel kontrol SEO pertama di dunia untuk banyak situs</h1>\r\n        <p>\r\n            Sebuah <b>panel kontrol SEO open source</b> yang lengkap untuk mengatur <b>optimasi mesin pencari</b> bagi situs Anda. \r\n            Seo Panel adalah sebuah <b>kumpulan kakas SEO</b> termasuk kakas SEO terbaru untuk <b>meningkatkan dan mengawasi performansi</b> situs Anda.\r\n            Ini adalah <b>perangkat lunak gratis</b> yang dirilis dengan lisensi<b>GNU GENERAL PUBLIC LICENSE</b>.\r\n            Fitur utama Seo Panel adalah <b>kemudahannya untuk diperluas</b> dengan menggunakan <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">Seo plugin</a>.\r\n            Siapapun bisa dengan mudah <b>membangun dan memasang</b> plugin yang dibutuhkan untuk Seo panel mereka. \r\n        </p>\r\n        <p></p>\r\n        <p>\r\n            Perangkat lunak open source ini <b>dirilis pada Januari 2010</b>.\r\n            Dalam <b>waktu singkat</b>, <b>ribuan pemilik situs</b> menggunakan perangkat lunak ini untuk <b>mengoptimalkan</b> website mereka.\r\n            Gunakan Seo panel hari ini dan <b>nikmati</b> semua yang berkaitan dengan Seo dalam <b>satu platform</b>.\r\n        </p>', '2012-03-18 02:18:39'),
