(9281, 'pt-BR', 'home', 'home_cont2', '<fieldset>\r\n<legend>Major features of SEO Panel <?=SP_INSTALLED?> </legend>\r\n<ul class=\\"infobox\\">\r\n<li>\r\n<h1> Tool for Auto Shipping Directory </h1>\r\n<p>\r\nThe tool for automatic directory submission helps us to send our websites <b> </b> for more <b> web directories, free or paid </b>.\r\nWe can also track the status <b> </b> every shipment made through a periodic check <b> </b> using the view script <b> status </b>.\r\nThe <b> Directory Manager </b> will help us find the <b> directories which are active </b> or not.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Viewer Positioning Keywords </h1>\r\n<p>\r\nViewer Positioning Keywords will find <b> positioning the sites search </b> <b> of target keywords </b>\r\nour website and store <b> </b> in our system.\r\nIn the reports section positioning of keywords, we can see the daily <b> posicições </b> from our keyword in different search engines via <b> cute graphics </b> and <b> reports detailed </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Auditor Sites </h1>\r\n<p> Site Auditor will audit all factors <b> SEO </b> of each page of a website and will provide a detailed report <b> </b> on each page. This will help us create sitemaps files <b> XML, HTML, TEXT </b> of our website to send them <b> </b> sites to search. </P>\r\n</Li>\r\n<li>\r\n<h1> Viewer Google Rank and Alexa </h1>\r\n<p>\r\nViewer Rank Alexa and Google will find Google pagerank <b> </b> <b> rank and rank </b> of our website and will store them <b> </b> in the system. .\r\nIn <b> reports rank </b>, we can see the log rank <b> </b> of every website on Google and Alexa <b> through detailed reports </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Viewer Back Links </h1>\r\n<p>\r\nViewer Back Links <b> will check and find the number of links back </b> of our website in different search <b> sites (google, yahoo, msn, etc) </b> will < b> store them </b> in the system.\r\nIn <br> <b> reports links back </b>, we can visualize <b> the daily count of links back </b> for each website through detailed reports <b> </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Viewer saturation Tracing Sites </h1>\r\n<p>\r\nViewer Saturation sites <b> searches will find the number of indexed pages </b> of our website in different search engines <b> (google, yahoo, msn etc) </b> and will <b> store them </b> in the system.\r\nIn <b> report viewer saturation sites search </b>, we can see the number of pages indexed <b> per day </b> for each website through detailed reports <b> </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Plugins for SEO Panel </h1>\r\n<p>\r\nThe biggest feature <b> </b> control panel SEO is its ability to <b> extension, customization </b>.\r\nAdd <b> Plugins SEO </b> on your SEO <b> Panel to extend the number of benefits </b> according to their needs.\r\n<A href = \\"<?=SP_PLUGINSITE?>\\" Target = \\"_blank\\"> The Panel Plugins for SEO </a> are offered by the SEO Panel and websites outsourced.\r\nYou can also easily develop <b> </b> SEO plugins for your SEO Panel.\r\nYou can <a href = \\"<?=SP_PLUGINSITE?>\\" Target = \\"_blank\\"> send </a> your SEO Plugins for SEO Panel and we will publish them <b> </b> on our website after of our processes <b> Review </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Generator Meta Tags </h1>\r\n<p>\r\nThe Generator Meta Tags is a Plugin for SEO <b> Panel </b> to create custom meta tags <b> </b> for your site.\r\nIt will help you give more information <b> </b> on your website for search engine robots <b> </b> when they crawl your website.\r\n</P>\r\n</Li>\r\n</Ul>\r\n</Fieldset> ', '2012-05-14 09:53:54'),
