(9285, 'pt-br', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Bem-vindos ao SEO Panel - O primeiro painel de controle do mundo para múltiplos websites</h1> \r\n        <p> \r\n            Um completo <b>painel de controle de SEO open source</b> para gerenciamento de <b>otimização para motores de busca (SEO)</b> dos seus websites.  \r\n            O SEO Panel é uma <b>junção de ferramentas de SEO</b> que inclui as mais recentes ferramentas de SEO para <b>alavancar e monitorar</b> a\r\n<b>performance</b> dos seus websites. \r\n            Este é um software <b>gratuito</b> publicado através da licença <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n            A principal característica do SEO Panel é a sua capacidade de <b>expansão</b> através do uso de <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">Plugins de SEO</a>. \r\n            Qualquer pessoa pode facilmente <b>desenvolver e instalar</b> os plugins necessários para o seu SEO Panel.  \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            Trata-se de um software open source <b>lançado em Janeiro de 2010</b>. \r\n            Neste <b>pequeno período</b> de tempo, <b>milhares</b> de <b>profissionais web</b> passaram a utilizar este software para <b>otimizar</b> os seus websites. \r\n            Passe a utilizar hoje mesmo o SEO Panel em seus projetos e <b>desfrute</b> tudo que está relacionado ao bom SEO em <b>uma única plataforma</b>. \r\n        </p>', '2012-05-14 09:53:54'),
(9286, 'pt-br', 'home', 'home_cont3', '<fieldset> \r\n<legend>SEO Panel - Recursos Online</legend>     \r\n<ul class=\\"infobox\\"> \r\n\r\n    <li> \r\n        <h1>Recursos Online do SEO Panel para Referência</h1>                 \r\n         \r\n         \r\n        <p> \r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Site oficial do SEO Panel</a> \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Download do SEO Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Demonstração do SEO Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Entre em contato com o SEO Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Guia de Ajuda do SEO Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Forum do SEO Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Sistema de Suporte do SEO Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Contribua com o SEO Panel</a> \r\n        </p> \r\n    </li> \r\n     \r\n</ul> \r\n</fieldset>', '2012-05-14 09:53:54'),
