(9963, 'lt', 'home', 'home_cont1', '<h1 style="text-align: center;margin-bottom: 30px;font-size: 19px;"> Sveiki atvykę į SEO Panel - Pasaulį\r\n1. SEO valdymo pultas keletui svetainių </h1>\r\n        <p>\r\n            Pilnas <b> atviro kodo SEO valdymo pultas </b> valdymo <b> Search Engine Optimization </b> jūsų tinklapis.\r\n            SEO skydas yra <b> SEO įrankių rinkinys </b> yra naujausi karšto SEO įrankiai <b> padidėjimo ir Track </b>\r\n<b> performace </b> savo interneto svetainėse.\r\n            Tai yra <b> nemokama programinė įranga </b> išleista pagal <b> GNU General Public License </b>.\r\n            Seo skydelio pagrindinis bruožas yra jos <b> extendability </b> naudodami <a href = "<?=SP_PLUGINSITE?>"\r\ntarget = "_blank"> SEO įskiepių </a>.\r\n            Kiek vienas gali lengvai <b> kurti ir diegti </b>, kuri reikalinga įskiepių savo SEO skydelyje.\r\n        </p>\r\n        <p> </p>\r\n        <p>\r\n            Tai atviro kodo programinė įrangą, kuri buvo išleista <b> sausio 2010 </b>.\r\n            Su šiame <b> trumpą laiką </b> laiko <b> tūkstančiai </b> iš <b> interneto meistrai </b> naudoja šią programinė įranga <b> optimizuoti </b> savo interneto svetaines.\r\n            Naudokite SEO skydelį šiandien ir <b> mėgaukitės </b> viską, kas susiję su SEO pagal <b> platforma </b>.\r\n        </p>', '2012-11-07 17:14:11'),
(9964, 'lt', 'home', 'home_cont2', '<fieldset>\r\n <legend>SEO Panel Pagrindinės ypatybės <?=SP_INSTALLED?> </legend>\r\n<ul class="infobox">\r\n    <li>\r\n        <h1> Automatinio katalogo pateikimo įrankis </h1>\r\n        <p>\r\n            Automatinis katalogo pateikimo įrankis padės jums <b> pateikti jūsų interneto svetainę </b> į pagrindinį <b> nemokamai ir mokamų interneto katalogus </b>.\r\n            Mes taip pat galime <b> sekti statusą </b> kiekviename submision <b> periodinio patikrinime </b>, naudodami pateikimas <b> statusas tikrintuvas scenarijus </b>.\r\n            <b> katalogas vadybininkas </b> padės mums sužinoti ar <b> katalogas yra aktyvus </b>, arba ne.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> Pozicijos raktažodžių tikrintuvas </h1>\r\n        <p>\r\n            Poziciją tikrintuvas raktažodžių rasite <b> paieškos poziciją </b> iš <b> targetowaną raktažodžius </b>\r\njūsų svetainę ir <b> parduotuvėse </b> juos į sistemą.\r\n            Raktažodžių skyriaus ataskaitos apie jo buvimo vietą, mes galime pamatyti <b> Dienos pozicijas </b> raktažodžių\r\nįvairiose paieškos sistemose pagal <b> gražių grafikų </b> ir <b> išsamios ataskaitos </b>.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> Svetainės auditorius </h1>\r\n        <p> Svetainės auditorius, <b> patikrinta SEO veiksniai </b> kiekvienos svetainės puslapių ir duos\r\n<b> išsamią ataskaitą </b> apie kiekvieną puslapį. Tai padės mums sukurti <b> XML, HTML, tekstas </b> Svetainės\r\nfailus <b> pateikti mūsų interneto svetainėje </b> į paieškos variklius. </p>\r\n    </Li>\r\n    <li>\r\n        <h1> Google ir Alexa Rank Checker </h1>\r\n        <p>\r\n            "Google" ir "Alexa Rank Checker rasite <B> Google PageRank </b> ir <b> alexa rank </b> mūsų\r\nsvetainės ir <b> parduotuvėse </b> į sistemą.\r\n            Į <b> rango ataskaitos </b>,, mes galime pamatyti į <b> kasdien </b> "Google ir Alexa reitingą kiekvieno svetainės\r\npagal <b> išsamias ataskaitas </b>.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> Atgalinės tikrintuvo </h1>\r\n        <p>\r\n            Atgalinės nuorodos tikrintuvas bus rasti Atgalinės nuorodos </b> mūsų interneto svetainėse <b> skaičių įvairiose paieškos\r\nvarikliai <b> (Google, Yahoo, MSN ir tt) </b> ir <b> parduotuvėse </b> sistemoje.\r\n            "<br> <b> atgalinę pranešimai </b>, mes galime pamatyti <b> Dienos Atgalinės skaičius </b> kiekvieno\r\nSvetainė <b> išsamias ataskaitas </b>.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> paieška Saturacija tikrintuvas </h1>\r\n        <p>\r\n            Paieška Variklis Saturacija tikrintuvas rasite <b> skaičių indeksuotų puslapių </b> mūsų interneto svetainėse\r\nįvairiose paieškos sistemose <b> (Google, Yahoo, MSN ir tt) </b> ir <b> parduotuvėse </b> sistemoje.\r\n            Į <b> paieškos soties tikrinimas ataskaitos </b>, mes galime pamatyti <b> kasdien indeksuojami puslapį\r\nskaičiuoti </b> kiekvieną svetainę, kurią pagal <b> išsamias ataskaitas </b>.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> SEO Panel Įskiepiai </h1>\r\n        <p>\r\n            <b> Pagrindinis bruožas </b> SEO valdymo skydelyje yra jos <b> extentability </b>.\r\n            Pridėkite <b> SEO įskiepių </b>, kad jūsų SEO skydelyje <b> išplėsti funkcijas </b> pagal jūsų\r\nreikalavimas.\r\n            <A href = "<?=SP_PLUGINSITE?>" Target = "_blank"> SEO įskiepių skydelio </a> yra tiek SEO lange\r\nir trečiųjų šalių svetainių.\r\n            Taip pat galite lengvai <b> sukurti </b> SEO įskiepių jūsų SEO skydelyje.\r\n            Galite <a href = "<?=SP_PLUGINSITE?>" Target = "_blank"> išsiųskite </a> jūsų SEO įskiepiai SEO skydelyje ir\r\nmes <b> Publikuoti </b> mūsų svetainėje po mūsų <b> peržiūros </b> proceso.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> Meta Tag Generator </h1>\r\n        <p>\r\n            Meta žymeles generatorius yra <b> SEO skydelis įskiepiai </b> sukurti <b> Custom meta žymeles </b> mūsų\r\nsvetainę.\r\n            Tai padės mums suteikti <b> daugiau informacijos </b> apie mūsų svetainę į <b> paieškos sistemos robotai </b>\r\no jie nuskaityti mūsų interneto svetainėje.\r\n        </P>\r\n    </Li>\r\n</Ul>\r\n</Fieldset>', '2012-11-07 17:14:11'),
(9965, 'lt', 'home', 'home_cont3', '<fieldset>\r\n<legend> SEO Panel Online ištekliai </legend>\r\n<ul class="infobox">\r\n\r\n    <li>\r\n        <h1> SEO pultas Online ištekliai Nuoroda </h1>\r\n         \r\n         \r\n        <p>\r\n            <a href="http://www.seopanel.in" target="_blank"> SEO Panel Oficiali svetainė </a>\r\n        </p>\r\n        <p>\r\n            <a href = "<?= SP_DOWNLOAD_LINK?>" target = "_blank"> Atsisiųsti SEO skydas </a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href = "<?= SP_DEMO_LINK?>" target = "_blank"> SEO Panel Demo </a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href = "<?= SP_CONTACT_LINK?>" target = "_blank"> conatct SEO Panel </a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href = "<?= SP_HELP_LINK?>" target = "_blank"> SEO Panel Pagalba vadovas </a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href = "<?= SP_FORUM_LINK?>" target = "_blank"> SEO Panel Forumas </a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href = "<?= SP_SUPPORT_LINK?>" target = "_blank"> SEO Panel paramos sistema </a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href = "<?= SP_DONATE_LINK?>" target = "_blank"> Parama SEO Panel </a>\r\n        </p>\r\n    </li>\r\n     \r\n</ul>\r\n</fieldset>', '2012-11-07 17:14:11'),
